\u0412\u043e\u043f\u0440\u043e\u0441 2.\u041a\u043e\u043c\u043c\u0435\u043d\u04:
Встретив более сильный японский крейсер, "Безупречный", в отличие от
"Бедового", не стал сдаваться и сражался с противником больше часа;
после боя японцы бросили тонувший корабль на произвол судьбы.

\u0412\u043e\u043f\u0440\u043e\u0441 223.\u041a\u043e\u043c\u043c\u0435\u043d\u04:
Эти строки в стихотворении написаны ямбом, который был любим Пушкиным;
правда, в следующей строке Маяковский пишет: "Вам теперь пришлось бы
бросить ямб картавый".
